CREATE TYPE sexo AS ENUM('Masculino', 'Femenino', 'Otro'); -- Se puede reutilizar en otras tablas 

CREATE TABLE ejemplo(
	ID SERIAL PRIMARY KEY,
	nombre VARCHAR(100) NOT NULL,
	descripcion TEXT,
	precio NUMERIC(10,2) NOT NULL,
	disponible BOOLEAN DEFAULT FALSE,
	fecha_creacion DATE NOT NULL,
	hora_creacion TIME NOT NULL,
	fecha_hora TIMESTAMP NOT NULL,
	fecha_zona TIMESTAMP WITH TIME ZONE,
	duracion INTERVAL,
	ip INET,
	mac MACADDR,
	punto_geo POINT,
	datos_json JSON,
	unico UUID,
	moneda MONEY,
	rangos INT4RANGE,
	colores VARCHAR(20)[],
	sexo_seleccionado sexo
);
-- DROP TABLE usuarios;
CREATE TABLE usuarios(
	id UUID NOT NULL DEFAULT gen_random_uuid(),
	first_name VARCHAR(100) NOT NULL,
	last_name VARCHAR(100) NOT NULL,
	email VARCHAR(250) NOT NULL,
	last_location INET NOT NULL,
	country VARCHAR(50) NOT NULL,
	blog VARCHAR(100) NOT NULL,
	username VARCHAR(50) NOT NULL, 
	followers INT4 NOT NULL,
	following INTEGER NOT NULL
);

